import React, { useState } from 'react'

const textStyle = {
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  padding: '8px',
  gap: '1.5rem',
  flexDirection: 'column',
}

function TextInput() {
  const [text, setText] = useState('...')

  const textUpdate = (event) => {
    let text = ''
    text = event.target.value
    setText(text)
  }

  return (
    <div style={textStyle}>
      <p>Input: {text}</p>
      <input placeholder="Serch" onChange={textUpdate} />
    </div>
  )
}

export default TextInput
